import styles from "./MainSection.module.css";
import faro from "../../img/faro.png";

const MainSection = () => {
	return (
		<section className={styles.section}>
			<div className={styles.left}>
				<img className={styles.img} src={faro} />
			</div>
		</section>
	);
};

export default MainSection;
